<script>
import ImageComponent from "@/components/imageComponent/ImageComponent.vue";
import anime from "animejs";

export default {
  name: 'Session4Page12',
  components: {ImageComponent},
  data() {
    return {
      options: ['Taste','Touch','Hearing','Smell','Sight'],
      hearing: '',
      sight: '',
      touch: '',
      smell: '',
      taste: '',
      correctAns: [],
    }
  },
  methods: {
    handleWrongAnswer() {
      anime({
        targets: '.sticker',
        easing: 'linear',
        opacity: [
          {value: 1, duration: 200},
          {value: 0, duration: 200, delay: 1000},
        ]
      })
      this.$refs.wrong.play();
      setTimeout(() => {this.$refs.goodTry.play()}, 500)
    },
    handleCorrectAnswer(maskId, tickId) {
      document.querySelector(maskId).style.visibility = 'visible';
      anime({
        targets: tickId,
        duration: 500,
        easing: 'linear',
        opacity: 1
      })
      this.$refs.correct.play();
      this.correctAns++;
    },
    afterFinishFunctions() {
      document.querySelector('.reward').style.opacity = '1';
      anime({
        targets: '.reward',
        scale: 20,
        duration: 1000,
      })
      this.$refs.celebrate.play();
      setTimeout(() => {this.$refs.veryGood.play()}, 500)
    },
    playVoiceOver() {
      setTimeout(() => {this.$refs.voice.play()}, 500)
    },
  },
  watch: {
    correctAns: function () {
      if (this.correctAns === 5) {
        this.afterFinishFunctions();
      }
      else {
        setTimeout(() => {this.$refs.correctVoice.play()}, 200)
      }
    },
    hearing: function () {
      if (this.hearing === 'Hearing') {
        this.handleCorrectAnswer('#hearing', '#tick-hearing');
      } else {
        this.handleWrongAnswer()
      }
    },
    sight: function () {
      if (this.sight === 'Sight') {
        this.handleCorrectAnswer('#sight', '#tick-sight');
      } else {
        this.handleWrongAnswer()
      }
    },
    touch: function () {
      if (this.touch === 'Touch') {
        this.handleCorrectAnswer('#touch', '#tick-touch');
      } else {
        this.handleWrongAnswer()
      }
    },
    smell: function () {
      if (this.smell === 'Smell') {
        this.handleCorrectAnswer('#smell', '#tick-smell');
      } else {
        this.handleWrongAnswer()
      }
    },
    taste: function () {
      if (this.taste === 'Taste') {
        this.handleCorrectAnswer('#taste', '#tick-taste');
      } else {
        this.handleWrongAnswer()
      }
    },
  },
  mounted() {
    this.playVoiceOver();
  },
}
</script>

